import React from 'react';
import style from './Post.module.css';
import user from '../../assets/userPhoto.jpg';
function Post() {
  const props = {
    userPhoto: 'http://www.wpkixx.com/html/winku-dark/images/resources/friend-avatar10.jpg',
    userName: 'Janice Griffith',
    postData: 'June,2 2018 19:00 PM',
    description:
      "World's most beautiful car in Curabitur #test drive booking ! The most beautiful car available in america and the Saudia Arabia, you can book your test drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.st drive by our official Website.",
    amountLike: 10,
    amountReposts: 10,
    amountComments: 10,
  };

  return (
    <div className={style.main}>
      <div className={style.username}>
        <img
          className={style.image}
          src={props.userPhoto ? props.userPhoto : user}
          alt="my image"
        />
        <div className={style.data_post}>
          <div className={style.name}>{props.userName} </div>
          <div className={style.data}> {props.postData}</div>
        </div>
      </div>
      <div>
        <div className={style.description}>{props.description}</div>
      </div>
      <div className={style.reaction}>
        <div className={style.like}>Like {props.amountLike}</div>
        <div className={style.comments}>Comments {props.amountComments} </div>
        <div className={style.reposts}>Reposts {props.amountReposts}</div>
      </div>
    </div>
  );
}

export default Post;
